import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import {Card, CardBody, CardImg, CardText, CardTitle, CardColumns,} from "reactstrap";

function Post() {
  return (
    <div className="d-flex justify-content-center mt-5">
      <CardColumns>
        <Card className="mb-2" style={{ width: '900px', marginTop: '50px' }}>
          <div className="col-md-">
            <CardImg
              alt="first Image"
              src="https://picsum.photos/400/250"
              style={{ width: "400px", height: "250px" }}
            />
            <CardImg
              alt="Second Image"
              src="https://picsum.photos/400/250"
              style={{width: "400px", height: "250px", marginLeft: "400px" }}
            />
          </div>
          <CardBody>
            <CardTitle tag="h3">Event Title</CardTitle>
            <CardText>Description</CardText>
            <CardText><small className="text-muted">TimeStamp</small> </CardText>
          </CardBody>
        </Card>
      </CardColumns>
    </div>
  );
}

export default Post;
